DROP DATABASE IF EXISTS DBMEGASENA;

CREATE DATABASE DBMEGASENA;

USE DBMEGASENA;

CREATE TABLE SORTEIOS (
	CONCURSO INT NOT NULL PRIMARY KEY
	, DTSORTEIO DATE
	, DEZENA_1 INT
	, DEZENA_2 INT
	, DEZENA_3 INT
	, DEZENA_4 INT
	, DEZENA_5 INT
	, DEZENA_6 INT
	, GANHADORES INT
	, VALOR DECIMAL(16,2)
);

CREATE TABLE DEZENAS (
	CONCURSO INT NOT NULL
	, ORDEM INT
	, NUMERO INT
	, PRIMARY KEY (CONCURSO, ORDEM)
);


SELECT CONCURSO, DEZENA_1, 1 FROM SORTEIOS UNION 
SELECT CONCURSO, DEZENA_2, 2 FROM SORTEIOS UNION 
