SELECT CONCURSO, DEZENA_4, 4 FROM SORTEIOS UNION 
SELECT CONCURSO, DEZENA_5, 5 FROM SORTEIOS UNION 
SELECT CONCURSO, DEZENA_6, 6 FROM SORTEIOS ;



